679ecc36-64b7-4210-8c07-1ba31316ff22	0	0	\N	\N	\N	t	Welcome to Space Teams!	This is your dashboard for setting up \n\nteams and tracking your activity scores.  Everything you need to know\n\nas the competition progresses will be found here.  Keep an eye out\n\nfor any announcements or updates on this Bulletin Board.  Use the\n\nLeaderboard to track your progress and compare your performance \n\nto other teams.  Under the Competitions tab you can find a more\n\ndetailed breakdown of your score cards on each activity.  If you need\n\nhelp with anything, use the help button on the right and send us a\n\nquestion.  Good luck on your mission!	2021-06-28 12:23:11.421051
d14f4bc6-ac61-4715-b52a-c6059881a947	1	1	bed3e27d-b1b6-45ce-b855-c55783fb8b06	\N	\N	f	Welcome to Day 4 of Space Teams!	Today you will need to safely land on the planet Vulcan. Pay close attention to your flight training and good luck. Also, check your email for a message about an update to the software.  You should download the software before running any more flight simulations. Another great day in Space!	2021-07-01 00:02:32.188439
96950183-5e53-45e9-9b33-56592a6d719c	0	1	bed3e27d-b1b6-45ce-b855-c55783fb8b06	\N	\N	t	Welcome Space Explorers!	Now that Space Teams is underway, be sure to sign onto the Learning Platform space-teams.spacecraft-vr.com.  This is where you should be to watch lessons and do the other daily activities. You can always come back here to get help (blue button on the right side), organize your team, and view your score on the leaderboard.  The SpaceCRAFT software download is available here (from the download tab above). Good luck and we’ll see you again on the learning platform.  Remember that we have live events at 10am and 2pm every day.	2021-06-28 17:24:32.954891
e4628ef5-558f-4ae8-a345-af6469539abf	0	1	bed3e27d-b1b6-45ce-b855-c55783fb8b06	\N	\N	f	Invite To Sim Feature	You will now see an 'Send Sim Invite' button under your team. This button will allow you to send an invitation email to the user you select asking them to meet you in the SpaceCRAFT application lobby. After sending the invite, wait in the main lobby (the main menu with all the activities) for them to join, and then you can coordinate joining a sim with them in the lobby voice chat.	2021-06-30 00:27:55.601189
